import { createRouter, createWebHistory } from 'vue-router';
import HomePage from '../views/home.vue';
import PageW1 from '../views/PageW1.vue';
import PageTwo from '../views/PageW2.vue';
import PageThree from '../views/PageW3.vue';
import PageFour from '../views/PageW4.vue';
import PageFive from '../views/PageW5.vue';

const routes = [
  {
    path: '/',
    name: 'Home',
    component: HomePage
  },
  {
    path: '/pageW1',
    name: 'B1-K1-W1',
    component: PageW1
  },
  {
    path: '/page2',
    name: 'Page2',
    component: PageTwo
  },
  {
    path: '/page3',
    name: 'Page3',
    component: PageThree
  },
  {
    path: '/page4',
    name: 'Page4',
    component: PageFour
  },
  {
    path: '/page5',
    name: 'Page5',
    component: PageFive
  }
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
});

export default router;
